            <div class="navbar-item">
                <div class="buttons">
                <a class="button" onClick={props.logout}>
                    Logout
                </a>
                </div>
            </div>
            </div>
        </div>
        </nav>

           <div className="content">
               {props.userInfo.quote}
           </div>

        <section className="hero-body">
        <div className="block">Hello {props.userInfo.name} remember "{props.userInfo.quote}"</div>

        <div className="block">
        <NewCategoryForm userInfo={props.userInfo} addCategory={props.addCategory}/></div>
